import React from 'react';
import './MessageBubbles.css'; // Assurez-vous de créer un fichier CSS pour les bulles de messages

function MessageBubbles({ userMessage, apiMessage }) {
  return (
    <div className="message-bubbles">
      <div className="user-bubble bubble">
        {userMessage}
      </div>
      <div className="api-bubble bubble">
        {apiMessage}
      </div>
    </div>
  );
}

export default MessageBubbles;
